import React from "react";
import { Link } from "react-router-dom";

function Header() {
  return (
    <div className="Header">
      <h2>Logo</h2>
      <div className="nav">
        <Link className="navLinks" to="Home" />
        <Link className="navLinks" to="How it Works" />
        <Link className="navLinks" to="Rental Details" />
        <Link className="navLinks" to="Why us" />
        <Link className="navLinks" to="Testimonial" />
        <Link className="navLinks" to="Register" />
        <Link className="navLinks" to="Register" />
        <button>
          <Link />
          login
        </button>
      </div>
    </div>
  );
}

export default Header;
